import React from 'react';

function InfoTooltip(props) {
    return (
    <article class={`${props.isOpen ? `popup popup_type_${props.name} popup_type_opened` : `popup popup_type_${props.name}`}`}>
        <div class="popup__container">
            <button type="button" class="popup__button popup__button_type_close" aria-label="close"/>
            <h3 class="popup__title popup__title_type_small">Вы уверены?</h3>
            <button type="submit" class="popup__button popup__button_type_save popup__button_type_small">Да</button>
        </div>
    </article>

    )
}

export default InfoTooltip;
